import { Route, BrowserRouter as Router, Switch } from "react-router-dom";

import { AddCountry } from "./features/users/AddCountry";
import React from "react";
import { CountryList } from "./features/users/CountryList";

export default function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route path="/add-user">
            <AddCountry />
          </Route>
          <Route path="/">
            <CountryList />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}
